class CanonicalizationMLP(nn.Module):
    def __init__(self, 
                 xyz_dim=3, 
                 pose_dim=69,         # e.g., SMPL pose (24 joints * 3 axis-angle)
                 time_dim=1, 
                 cam_dim=6,           # e.g., camera position + direction
                 hidden_dim=256, 
                 output_dim=3,        # xyz canonical output
                 use_time=True, 
                 use_camera=False):
        super().__init__()
        
        input_dim = xyz_dim + pose_dim
        if use_time:
            input_dim += time_dim
        if use_camera:
            input_dim += cam_dim

        self.fc1 = nn.Linear(input_dim, hidden_dim)
        self.fc2 = nn.Linear(hidden_dim, hidden_dim)
        self.fc3 = nn.Linear(hidden_dim, hidden_dim)
        self.fc4 = nn.Linear(hidden_dim, output_dim)  # outputs canonical xyz

        self.use_time = use_time
        self.use_camera = use_camera

    def forward(self, xyz, pose, time=None, cam=None):
        """
        Inputs:
        xyz:   [B, 3]       - B = number of Gaussians
        pose:  [1, pose_dim]
        time:  [1, 1]       (optional)
        cam:   [1, cam_dim] (optional)

        Output:
        canonical_xyz: [B, 3]
        """
        B = xyz.shape[0]

        # Broadcast shared inputs to match B
        pose_broadcast = pose.expand(B, -1)  # [B, pose_dim]

        inputs = [xyz, pose_broadcast]

        if self.use_time:
            if time is None:
                raise ValueError("Time input required but not provided.")
            time_broadcast = time.expand(B, -1)  # [B, 1]
            inputs.append(time_broadcast)

        if self.use_camera:
            if cam is None:
                raise ValueError("Camera input required but not provided.")
            cam_broadcast = cam.expand(B, -1)  # [B, cam_dim]
            inputs.append(cam_broadcast)

        x = torch.cat(inputs, dim=-1)  # [B, input_dim]

        x = F.relu(self.fc1(x))
        x = F.relu(self.fc2(x))
        x = F.relu(self.fc3(x))
        out = self.fc4(x)              # [B, 3]

        return out


def set_gaussian_model_features(model: GaussianModel, features: dict):
    """
    Sets feature tensors on a GaussianModel instance without wrapping in nn.Parameter,
    preserving gradient history.

    Args:
        model (GaussianModel): The target GaussianModel.
        features (dict): Dictionary with keys and shapes:
            - 'xyz': (P, 3)
            - 'features_dc': (P, 3, 1)
            - 'features_rest': (P, 3, (sh_degree+1)^2 - 1)
            - 'opacity': (P, 1)
            - 'scaling': (P, 3)
            - 'rotation': (P, 4)
    """
    model._xyz = features["xyz"]
    model._features_dc = features["features_dc"]
    model._features_rest = features["features_rest"]
    model._opacity = features["opacity"]
    model._scaling = features["scaling"]
    model._rotation = features["rotation"]

    model.max_radii2D = torch.zeros((features["xyz"].shape[0]), device=features["xyz"].device)

    # print(f"Gaussian model features set. Num points: {features['xyz'].shape[0]}")


